import { Link } from "react-router-dom";
import PortraitLanding from "../../Assets/PortraitLanding.png";
import "./LandingPage.modules.css"

const LandingPage = () => {
    return (
        <>
            <div className="bodyLanding">

                <h1 className="landingText">Welcome to DoggoApi</h1>
                
                <div>
                    <img src = {PortraitLanding} alt = ""/>
                </div>

                <Link to = {`/Dogs`}>
                    <button className="enter-button">Enter</button>
                </Link>
                
            </div>
        </>
    )
}

export default LandingPage;
